const Post = (props) => {
    const fetchPost = () => {
        fetch("/fetchBlogPostById", {
            method: "POST",
            headers: {
                "Content-Type" : "application/json"
            },
            body: JSON.stringify(props.id)
        })
    }
    return (
        <h1>Wow it works.{props.id}</h1>
    )
}
export default Post;
